import React from "react";
import { useNavigate } from "react-router-dom";

import backArrowBlack from '../../assets/back-arrow-black.png'

const ToLastPage = ({style}) => {
    const navigate = useNavigate();
    const goBack = () => {
        navigate(-1);
    };

    return (
        <div>
            <button
            onClick={goBack}
            className={style}>
                <picture>
                    <img srcSet={backArrowBlack} className="h-12"></img>
                </picture>
                Back
            </button>
        </div>
    )
}

export default ToLastPage;
